      {"9c22eafa-0ee7-4f93-8f2e-fb314c99dfec":{"version":"3.6.0","title":"Bokeh Application","roots":[{"type":"object","name":"Tabs","id":"p15208","attributes":{"sizing_mode":"stretch_both","tabs":[{"type":"object","name":"TabPanel","id":"p15199","attributes":{"title":"Summary","child":{"type":"object","name":"Div","id":"p15198","attributes":{"styles":{"type":"map","entries":[["width","100%"],["height","100%"],["max-width","1920px"],["max-height","1080px"],["padding","12px"],["border","1px solid lightgray"],["box-shadow","inset 1px 0 8px 0 lightgray"],["overflow","auto"]]},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 210.21 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 10789 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 585.38 s &lt;/li&gt;\n&lt;li&gt; disk-write time: 437.24 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 81.63 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.99.252.196:44341 &lt;/li&gt;\n          &lt;li&gt; Workers: 6 &lt;/li&gt;\n          &lt;li&gt; Threads: 12 &lt;/li&gt;\n          &lt;li&gt; Memory: 29.82 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2024.12.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2024.12.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n%%time\n# Define configurations without n_jobs parameter\nslurm_configs = {\n    '1core_with_1process': {\n        'cores': 1,\n        'memory': '24GB',\n        'processes': 1,\n        'min_workers': 1,\n        'max_workers': 1\n    },\n    '12cores_with_6process': {\n        'cores': 12,\n        'memory': '32GB',\n        'processes': 6,\n        'min_workers': 8,\n        'max_workers': 20\n    },\n    '12_cores_with_8process': {\n        'cores': 12,\n        'memory': '32GB',\n        'processes': 8,\n        'min_workers': 20,\n        'max_workers': 30\n    }\n}\n\npopular_stocks = ['AAPL', 'GOOGL', 'MSFT', 'AMZN']\nresults = {}\n\nfor config_name, params in slurm_configs.items():\n    print(f\"\\nTesting SLURM {config_name} configuration:\")\n    start_time = time.time()\n    \n    \n    try:\n        \n        world_size = params['cores'] * params['processes'] * params['max_workers']\n        job_script_prologue = [\n            'export MASTER_ADDR=$(hostname)',\n            'export MASTER_PORT=29500',\n            f'export WORLD_SIZE={world_size}',\n            'export LOCAL_RANK=${SLURM_LOCALID}',\n            f'export RANK=$((SLURM_NODEID * {params[\"processes\"]} + SLURM_LOCALID))'\n        ]\n        \n        # Create cluster with remaining parameters\n        cluster = SLURMCluster(\n            queue='courses',\n            walltime='01:00:00',\n            death_timeout=60,\n            nanny=True,\n            cores=params['cores'],\n            memory=params['memory'],\n            processes=params['processes'],\n            job_script_prologue=job_script_prologue,\n            worker_extra_args=[\"--lifetime\", \"55m\", \"--lifetime-stagger\", \"4m\"],\n        )\n        \n        \n        cluster.adapt(minimum=params['min_workers'], maximum=params['max_workers'])\n        \n        # Create client and run computation\n        client = Client(cluster)\n\n        display(HTML(f\"&lt;a href='{client.dashboard_link}'&gt;Dask Dashboard&lt;/a&gt;\"))\n        print(f\"Dashboard link: {client.dashboard_link}\")\n        print(f\"Cluster status: {client.status}\")\n        \n        scaling_logger = ScalingLogger(logger)\n        client.register_plugin(scaling_logger)\n        \n        with performance_report(filename=f\"performance_report_cnn_{config_name}.html\"):\n            predictions, actuals = main(popular_stocks)\n        \n        print(\"Main Function Done..!\")\n        \n        execution_time = time.time() - start_time\n        \n        scheduler_info = client.scheduler_info()\n        workers = scheduler_info.get('workers', {})\n        \n        results[config_name] = {\n            'execution_time': execution_time,\n            'configuration': params,\n            'scaling_jobs': len(workers),\n        }\n        \n        print(f\"Configuration: {config_name}\")\n        print(f\"Execution time: {execution_time:.2f} seconds\")\n        \n    except Exception as e:\n        print(f\"Error with configuration {config_name}: {str(e)}\")\n        results[config_name] = {'error': str(e)}\n        \n\n# Print results summary\nprint(\"\\nResults Summary:\")\nfor config, result in results.items():\n    if 'error' in result:\n        print(f\"{config}: Error - {result['error']}\")\n    else:\n        print(f\"{config}: {result['execution_time']:.2f} seconds\")\n        print(f\"Configuration: {result['configuration']}\")\n        print(f\"Scaling jobs: {result['scaling_jobs']}\")\n    print(\"-\" * 50)\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p15203","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p14843","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p14841","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p14842","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p14853"},"y_scale":{"type":"object","name":"LinearScale","id":"p14854"},"title":{"type":"object","name":"Title","id":"p14846","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p14883","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p14838","attributes":{"selected":{"type":"object","name":"Selection","id":"p14839","attributes":{"indices":[],
